import React, { Component } from 'react'
import { Container, TodoTbale } from './Todo'

export default class Todo extends Component {
  constructor(props) {
    super(props)
    this.state = {
      data: [
        { id: 1, todo: 'Nonushta' },
        { id: 2, todo: 'ish' },
        { id: 3, todo: 'O`yin' },
      ],
      inputValue: ""
    }
  }
  addTodo() {
    this.setState({
      data: this.state.inputValue.length >= 1 ? [
        ...this.state.data,
        {
          id: this.state.data.length + 1,
          todo: this.state.inputValue
        }
      ] : this.state.data,
      inputValue: "",
    })
  }
  render() {
    const onKey = (e) => {
      if (e.key === 'Enter') {
        this.setState({
          data: this.state.inputValue.length >= 1 ? [
            ...this.state.data,
            {
              id: this.state.data.length + 1,
              todo: this.state.inputValue
            }
          ] : this.state.data,
          inputValue: "",
        })
      }
    }
